import {useState} from 'react'
import axios from 'axios'
import {API} from '../config'
export default function Register() {

    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const handleSubmit = async (e) =>{
        e.preventDefault();
        try {

            // console.log(email,password)
          const {data,status} = await axios.post(`${API}/register`,{email,password})
          console.log(status,data)

        } catch (error) {
            console.log(e)
        }
    }


    return (
      <div>
        <h1 className="display-1 bg-primary text-light p-5">Register</h1>
  
        <div className="container">
          <div className="row">
            <div className="col-md-4 offset-md-4 mt-5">
              <form onSubmit={handleSubmit}>
                <input
                  type="text"
                  placeholder="Enter your email"
                  className="form-control mb-4"
                  required
                  autoFocus
                  value={email}
                  onChange={e =>setEmail(e.target.value) }
                />
  
                <input
                  type="password"
                  placeholder="Enter your password"
                  className="form-control mb-4"
                  required
                  value={password}
                  onChange={e =>setPassword(e.target.value) }
                />
  
                <button  className="btn btn-primary col-12 mb-4">Register</button>
              </form>
  
              {/* <a className="text-danger pointer">Forgot Password</a> */}
            </div>
          </div>
        </div>
      </div>
    );
  }
